import React from "react";


function Header() {
  return (
    <>
      <header>
        <div className="logo-container">
          <img
            src="https://res.cloudinary.com/dsesprxhl/image/upload/v1702051982/portfolio/logo_lc45fc.png"
            alt=""
          />
        </div>
        <div>
          <Navbar />
        </div>

      </header>
    </>
  );
}

export default Header;
